import React from 'react';
import Rating from 'material-ui-rating';


class Rate extends React.Component{
  render(){
    return(
      <Rating
          value={3}
          max={5}
          onChange={(value) => console.log(`Rated with value ${value}`)}
        />
    )
  }
}
export default Rate
